INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `idadmin`) VALUES
(14, 'Haaland phá kỷ lục của cựu tiền đạo Man Utd', 13, 11, '<p><span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Tiền đạo Man City Erling Haaland phá kỷ lục cầu thủ cần ít trận nhất để ghi 50 bàn Ngoại hạng Anh của Andy Cole.</span></p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Tối 25/11, với bàn mở tỷ số trong trận Man City hoà Liverpool 1-1 ở vòng 13, Haaland cán mốc 50 bàn Ngoại hạng Anh. Tiền đạo 23 tuổi người Na Uy chỉ cần 48 trận để đạt con số này, trong khi kỷ lục trước đó thuộc về Andy Cole với 65 trận. Điểm nổi bật duy nhất của Cole là không cần bất cứ quả phạt đền nào khi xác lập cột mốc kể trên.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Các cầu thủ xếp tiếp theo trong danh sách này gồm: Alan Shearer (66 trận), Ruud Van Nistelrooy (68 trận), Fernando Torres và Mohammed Salah (72 trận).</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 453.038px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture data-inimage=\"done\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg 1x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xcx-PFKQYAOHli8U1sNiOA 1.5x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=TSEpQiGWBGdJCP8bibcUrw 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg 1x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=xcx-PFKQYAOHli8U1sNiOA 1.5x, https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=TSEpQiGWBGdJCP8bibcUrw 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" loading=\"lazy\" intrinsicsize=\"680x0\" alt=\"Haaland sút ghi bàn trong trận Man City 1-1 Liverpool ở vòng 13 Ngoại hạng Anh tối 25/11, trên sân Etihad. Ảnh: Reuters\" class=\"lazy lazied\" src=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg\" data-src=\"https://i1-thethao.vnecdn.net/2023/11/26/haaland3-8401-1700963384.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=2GbMq-57kShLwewnU6Nmlg\" data-ll-status=\"loaded\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; font-size: 0px; line-height: 0; max-width: 100%; position: absolute; top: 0px; left: 0px; max-height: 700px; width: 680px;\"><div class=\"embed-container-ads\" style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; text-rendering: optimizelegibility; width: 680px; background: transparent; overflow: hidden; float: left; height: 100px; position: absolute; bottom: -1px; margin-bottom: 0px !important; padding-bottom: 0px !important;\"><div id=\"sis_inimage\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; position: relative; width: 680px; height: 100px;\"></div></div></picture></div><figcaption itemprop=\"description\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility; width: 680px; float: left; text-align: left;\"><p class=\"Image\" style=\"padding: 10px 0px 0px; text-rendering: optimizespeed; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 22.4px;\">Haaland sút ghi bàn trong trận Man City 1-1 Liverpool ở vòng 13 Ngoại hạng Anh tối 25/11, trên sân Etihad. Ảnh:&nbsp;<em style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\">Reuters</em></p></figcaption></figure><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Với Man Utd, Cole từng giành năm Ngoại hạng Anh và một Champions League. Trên mọi đấu trường, huyền thoại 52 tuổi từng ghi 121 bàn trong 257 trận cho Man Utd, 68 bàn trong 84 trận cho Newcastle, 37 bàn trong 100 trận cho Blackburn Rovers, 13 bàn trong 39 trận cho Fulham và 10 bàn trong 23 trận cho Man City.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Mục tiêu tiếp theo của Haaland có thể là cầu thủ ghi 100 bàn Ngoại hạng Anh nhanh nhất. Shearer đang giữ kỷ lục này qua 124 trận.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Mùa trước, với 36 bàn,&nbsp;<a href=\"https://vnexpress.net/chu-de/erling-haaland-979\" rel=\"dofollow\" data-itm-source=\"#vn_source=Detail-TheThao_NgoaiHangAnh_TinTuc-4681390&amp;vn_campaign=Box-InternalLink&amp;vn_medium=Link-Haaland&amp;vn_term=Desktop&amp;vn_thumb=0\" data-itm-added=\"1\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Haaland</a>&nbsp;đã phá kỷ lục cầu thủ ghi nhiều bàn nhất trong một mùa Ngoại hạng Anh. Kỷ lục trước đó là 32 bàn do Salah lập vào mùa 2017-2018.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trên sân Etihad hôm qua, Haaland mở tỷ số phút 27. Sau khi nhận đường chuyền của Nathan Ake, tiền đạo 23 tuổi chạm hai nhịp để đưa bóng vào vòng cấm và ổn định vị trí rồi sút bật tay thủ môn Alisson. Tuy nhiên, Man City không bảo toàn được ba điểm. Phút 80, sau đường chuyền của Salah, Trent Alexander-Arnold sút chéo góc gỡ hòa cho&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/liverpool-40\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Liverpool</a>.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Sau trận này,&nbsp;<a href=\"https://vnexpress.net/the-thao/du-lieu-bong-da/doi-bong/man-city-50\" rel=\"dofollow\" style=\"margin: 0px; padding: 0px 0px 1px; text-rendering: optimizelegibility; color: rgb(7, 109, 182); position: relative; text-underline-position: under; border-bottom-width: 1px; border-bottom-style: solid;\">Man City</a>&nbsp;mất vị trí dẫn đầu khi chỉ có 29 điểm sau 13 trận. Trong khi đó, sau trận thắng 1-0 trên sân của Brentford, Arsenal lên dẫn đầu với 30 điểm. Liverpool xếp thứ ba với 28 điểm.</p><p><br></p>', '2023-11-26 07:45:12', NULL, 1, 'Haaland-phá-kỷ-lục-của-cựu-tiền-đạo-Man-Utd', '3a0d281851a56526d9e258a7690b497f.jpg', NULL),
(15, 'HAGL chôn chân ở đáy bảng V-League', 13, 11, '<p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Thua ngược Thể Công 1-2 ở vòng 5, HAGL nối dài mạch không thắng từ đầu V-League 2023-2024 và tiếp tục ở cuối bảng.<br></p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trước trận đấu trên sân Pleiku chiều 8/12, HAGL hòa hai và thua hai tại V-League 2023-2024, đồng thời bị loại ngay vòng sơ loại Cup Quốc gia. Điều này phản ánh phần nào thực tế u tối đang diễn ra bên trong đội bóng. Bên cạnh việc phải đổi tên, trở thành LPBank HAGL, họ còn có những xáo trộn về nhân sự và sắp tới có thể là ở nhóm lãnh đạo bên trên.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Trong bối cảnh này, các cầu thủ HAGL không thể làm gì khác ngoài việc tập trung vào chuyên môn, cố gắng thi đấu tốt để cải thiện vị trí. Việc tiếp Thể Công - đội bóng cũng không có phong độ cao nhất từ đầu mùa - được đánh giá là cơ hội để thầy trò HLV Kiatisuk Senamuang hướng đến chiến thắng đầu tiên từ đầu mùa.</p><p class=\"Normal\" style=\"margin-bottom: 1em; padding: 0px; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\">Phút thứ 2, Jhon Cley sút phạt mạnh cách khung thành Thể Công gần 30 mét, khiến thủ môn Phạm Văn Phong vất vả cản phá. Đến phút 15, Châu Ngọc Quang đi bóng bên cánh trái dứt điểm chệch đích, nhưng vô tình thành kiến tạo để Minh Vương đệm cận thành mở tỷ số.</p><figure data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\" class=\"tplCaption action_thumb_added\" style=\"margin-right: auto; margin-bottom: 15px; margin-left: auto; padding: 0px; text-rendering: optimizelegibility; max-width: 100%; clear: both; position: relative; text-align: center; width: 680px; float: left; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246);\"><div class=\"fig-picture\" style=\"margin: 0px; padding: 0px 0px 500px; text-rendering: optimizelegibility; width: 680px; float: left; display: table; -webkit-box-pack: center; justify-content: center; background: rgb(240, 238, 234); position: relative;\"><picture data-inimage=\"done\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><source data-srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=XgZm_d4YgcrLnDAJzcp60g 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=g0PdFcw7dokn4G2JizIFxA 2x\" srcset=\"https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Q1WScapXqiAxnZROGuUm8g 1x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=XgZm_d4YgcrLnDAJzcp60g 1.5x, https://i1-thethao.vnecdn.net/2023/12/08/hagl-the-cong-vong-5-v-league-1526-8346-1702037421.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=g0PdFcw7dokn4G2JizIFxA 2x\" style=\"margin: 0px; padding: 0px; text-rendering: optimizelegibility;\"><img itemprop=\"contentUrl\" lo