INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`, `idadmin`) VALUES
(25, 'Ngược dòng cảm xúc, Tai Tzu Ying vô địch giải cầu lông World Tour Finals 2023', 16, 18, '<p><span style=\"color: rgb(41, 41, 41); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px; text-align: justify;\">Trận chung kết nội dung đơn nữ giải cầu lông danh giá BWF World Tour Finals 2023 giữa Tai Tzu Ying và Carolina Marin diễn ra lúc 15h30 ngày 17/12, hứa hẹn sự kịch tính và hấp dẫn .</span></p><p><span style=\"color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px; text-align: justify;\">Bại tướng của tay vợt&nbsp;</span><strong style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px; text-align: justify;\"><a class=\"\" href=\"https://thethao247.vn/460-thuc-hu-nguyen-thuy-linh-bo-giai-cau-long-danh-gia-nam-2024-d308418.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: inline;\">Nguyễn Thùy Linh</a></strong><span style=\"color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px; text-align: justify;\">&nbsp;tại China Mastes 2023, Carolina Marin giành quyền vào chung kết BWF World Tour Finals vô cùng thuyết phục. Cô vượt qua nhà vô địch Chen Yu Fei tại trận bán kết căng thẳng ngày 16/12. Phong độ xuất sắc của tay vợt Tây Ban Nha mang đến hy vọng nâng cúp tại giải đấu danh giá cuối năm.</span></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Đối thủ của Marin tại chung kết World Tour Finals là tay vợt số 4 thế giới - Tai Tzu Ying. Đại diện Đài Bắc Trung Hoa cũng chứng tỏ sự có mặt của mình qua trận đấu giằng co với thần đồng Hàn Quốc An Se Young.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Tai Tzu Ying khởi đầu không tốt so với đối thủ. Cô để Marin áp đặt những đường cầu khó về phía cuối sân. Tay vợt Tây Ban Nha tỏ rõ ý đồ kéo lưới, thường xuyên bỏ nhỏ sát lưới.</p><figure class=\"expNoEdit\" style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-width: 100%; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"><a href=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374599.jpg\" rel=\"nofollow noopener\" data-caption=\"Carolina Marin khởi đầu ấn tượng trong set mở màn\" data-at-1366=\"https://cdn-img.thethao247.vn/origin_1366x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374599.jpg\" data-at-1920=\"https://cdn-img.thethao247.vn/origin_1920x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374599.jpg\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: block;\"><img class=\" lazyloaded\" data-src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374599.jpg\" src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374599.jpg\" width=\"1158\" height=\"625\" alt=\"Ngược dòng cảm xúc, Tai Tzu Ying vô địch giải cầu lông World Tour Finals 2023 374599\" title=\"\" data-adbro-processed=\"true\" style=\"margin: 0px auto; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; vertical-align: bottom; background: 0px 0px; max-width: 100%; height: auto; display: block;\"></a><figcaption style=\"margin: 0px; padding: 8px 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: rgb(242, 242, 242); color: rgb(97, 97, 97); text-align: center; font-size: 15.48px;\">Carolina Marin khởi đầu ấn tượng trong set mở màn</figcaption></figure><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Khả năng di chuyển của Tai Tzu Ying rất tốt nhưng cô rõ ràng không thể duy trì những bước chạy với tần suất cao. Set 1 kết thúc với chiến thắng cách biệt 21-12 cho Carolina Marin.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Thua chóng vánh trong set mở màn, tay vợt Đài Bắc Trung Hoa thi đấu tập trung hơn. Những tình huống xử lý của cô bắt đầu có cảm giác hơn. Tai Tzu Ying chủ động ép trái sâu đối thủ, khiến Marin luôn phải đỡ cầu vặn sườn.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Từng điểm chạm cầu của đại diện Đài Bắc đều khiến tay vợt Tây Ban Nha di chuyển vất vả. Marin liên tiếp đánh hỏng ở những điểm số cuối set đấu, tạo đà cho Tai Tzu Ying đưa trận đấu về vạch xuất phát.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\"><figure class=\"expNoEdit\" style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-width: 100%; text-align: start;\"><a href=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374600.jpg\" rel=\"nofollow noopener\" data-caption=\"Tai Tzu Ying có màn lội ngược dòng cảm xúc để vô địch BWF World Tour Finals lần thứ 4 trong sự nghiệp\" data-at-1366=\"https://cdn-img.thethao247.vn/origin_1366x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374600.jpg\" data-at-1920=\"https://cdn-img.thethao247.vn/origin_1920x0/storage/files/btvttth1/2023/12/17/nguoc-dong-cam-xuc-tai-tzu-ying-vo-dich-giai-cau-long-world-tour-finals-2023-374600.jpg\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: block;\"></a></figure></p><p style=\"margin: 0px 0px 15px; padding: 0px; list-style: none; outline: 0px; box-sizing: border-box; border: 0px; vertical-align: bottom; background: 0px 0px rgb(255, 255, 255); font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Set quyết định diễn ra với thế trận giằng co ngay từ đầu. Marin nhanh chóng dẫn trước sau loạt đánh hỏng của Tai Tzu Ying. Tuy nhiên, tay vợt số 4 thế giới trở lại mạnh với những tình huống bỏ nhỏ rất nhạy cảm.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Tai Tzu Ying không thường xuyên tung ra những cú đập uy lực. Trái lại, cô đáp trả bằng các tình huống đập giấu tay rất hiểm, khiến đối thủ lỡ đà.Sau loạt rally căng thẳng, Marin tung ra cú đập trong tư thế khó. Cầu đi thẳng ra ngoài, mang về chức vô địch BWF World Tour Finals 2023 xứng đáng cho Tai Tzu Ying.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Đây là lần thứ 4 trong sự nghiệp, tay vợt Đài Bắc nâng cao chiếc cúp danh giá này. Cô cũng nhận được số tiền thưởng 200.000 USD cho nhà vô địch&nbsp;<a class=\"\" href=\"https://thethao247.vn/cau-long-c44/\" target=\"_blank\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: inline;\">World Tour Finals 2023</a>.</p><p><br></p>', '2023-12-17 12:42:20', NULL, 1, 'Ngược-dòng-cảm-xúc,-Tai-Tzu-Ying-vô-địch-giải-cầu-lông-World-Tour-Finals-2023', '4afda538255c2da14485f1fc97888ced.jpg', NULL),
(26, 'HAGL chìm sâu vào khủng hoảng', 13, 11, '<p><span style=\"color: rgb(41, 41, 41); font-size: 18px; text-align: justify;\"><font face=\"Times New Roman\">HAGL tiếp tục nhận trận thua tại V-League và chôn chân ở top cuối trên BXH.</font></span></p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Ở vòng 6, HAGL làm khách trên sân Vinh trước SLNA. Đây đều là 2 đội bóng chưa có chiến thắng nào ở đấu trường V-League 2023/24.</p><div class=\"teads-adCall\" style=\"margin: 0px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"></div><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Khác với trận đấu gần nhất, HLV Phan Như Thuật chọn thủ môn Nguyễn Văn Việt bắt chính trong khung gỗ. Tình huống đáng chú ý đầu tiên thuộc về đội khách với pha đánh đầu chệch cột dọc của Quốc Việt.</p><figure class=\"expNoEdit\" style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; min-width: 100%; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif; font-size: 18px;\"><a href=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/ninhdo/2023/12/17/truc-tiep-slna-1-0-hagl-no-luc-duoc-den-dap-374603.png?_gl=1*h8trci*_ga*MTU2MDIzMzU5MS4xNzAyODE1OTA2*_ga_QHPQDE0PQG*MTcwMjgxNzAyMy4xLjAuMTcwMjgxNzAyMy4wLjAuMA..\" rel=\"nofollow noopener\" data-caption=\"Ngô Văn Lương ghi bàn thắng duy nhất cho SLNA\" data-at-1366=\"https://cdn-img.thethao247.vn/origin_1366x0/storage/files/ninhdo/2023/12/17/truc-tiep-slna-1-0-hagl-no-luc-duoc-den-dap-374603.png\" data-at-1920=\"https://cdn-img.thethao247.vn/origin_1920x0/storage/files/ninhdo/2023/12/17/truc-tiep-slna-1-0-hagl-no-luc-duoc-den-dap-374603.png\" style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(27, 149, 224); vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition: all 0.3s ease 0s; cursor: pointer; display: block;\"><img class=\" lazyloaded\" data-src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/ninhdo/2023/12/17/truc-tiep-slna-1-0-hagl-no-luc-duoc-den-dap-374603.png\" src=\"https://cdn-img.thethao247.vn/origin_842x0/storage/files/ninhdo/2023/12/17/truc-tiep-slna-1-0-hagl-no-luc-duoc-den-dap-374603.png\" width=\"1284\" height=\"729\" alt=\"Trực tiếp SLNA 1-0 HAGL: Nỗ lực được đền đáp 374603\" title=\"\" data-adbro-processed=\"true\" style=\"margin: 0px auto; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; vertical-align: bottom; background: 0px 0px; max-width: 100%; height: auto; display: block;\"></a><figcaption style=\"margin: 0px; padding: 8px 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background: rgb(242, 242, 242); color: rgb(97, 97, 97); text-align: center; font-size: 15.48px;\">Ngô Văn Lương ghi bàn thắng duy nhất cho SLNA</figcaption></figure><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Phải đến phút thứ 37, thế bế tắc mới được khai thông. Ngô Văn Lương chớp thời cơ lao vào đá bồi mở tỷ số cho SLNA. Trước đó, thủ môn Trung Kiên không thể bắt dính bóng sau cú đá chân trái của Quang Vinh.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Sang hiệp 2, HAGL nỗ lực dồn ép để có bàn gỡ hoà nhưng không thành. Thủ môn trẻ tuổi Văn Việt tiếp tục cứu thua thành công sau cú sút phạt hàng rào của ngoại binh John Cley ở phút thứ 58.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Tiền vệ Nguyễn Tuấn Anh đưa bóng vào lưới SLNA sau cú đá nối ở phút 83. Tuy nhiên, trọng tài không công nhận bàn thắng do xác định A Hoàng đã việt vị.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Những phút còn lại, diễn biến trên sân Vinh trở nên nóng hơn nhiều do HAGL muốn có bàn quân bình tỷ số. Tuy nhiên, nỗ lực của Tuấn Anh và đồng đội không thể đem lại ít nhất 1 điểm cho đội bóng phố Núi.</p><p style=\"margin-bottom: 15px; padding: 0px; list-style: none; outline-style: initial; outline-width: 0px; border: 0px; vertical-align: bottom; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 18px; line-height: 1.6; text-align: justify; color: rgb(17, 17, 17); font-family: roboto, Helvetica, Arial, sans-serif;\">Để thua với tỷ số tối thiểu 0-1, HAGL vẫn chưa biết đến mùi chiến thắng kể từ vòng 1. Trong khi đó, đây chính là trận đấu đầu tiên ở V-League 2023/24 mà đội bóng xứ Nghệ có được 3 điểm tuyệt đối.</p><p><br></p>', '2023-12-17 12:45:05', NULL, 1, 'HAGL-chìm-sâu-vào-khủng-hoảng', '46ed293078d871d7e89651175a8464e0.jpg', NULL);

